def construction_ships(x,y,course):
    '''

    :param x:船舶坐标x
    :param y: 船舶坐标y
    :param course: 船舶航向
    :return:椭圆
    '''

    return Ellipse((x,y) ,40*3, 100*5, angle=360-course,facecolor='green', alpha=0.6)

def construction_ship(x,y,c,cl):
    return RegularPolygon((x,y),10,100,orientation=(360-c)*pi/180,color=cl)

def construction_domain(list_own):
    """
    ownShip:[x，y，航向,速度,船长，船宽]
    """
    L = list_own[4]*3  # 船长
    B = list_own[4]*1  # 船宽
    X_own = list_own[0]
    Y_own = list_own[1]
    course_own=list_own[2]

    if 0 <= course_own < 90:
        C = course_own * pi / 180
        X_inv = X_own + sin(C) * 0.25 * L
        Y_inv = Y_own + cos(C) * 0.25 * L

    elif 90 <= course_own < 180:
        C = (180 - course_own) * pi / 180
        X_inv = X_own + sin(C) * 0.25 * L
        Y_inv = Y_own - cos(C) * 0.25 * L

    elif 180 <= course_own < 270:
        C = (course_own - 180) * pi / 180
        X_inv = X_own - sin(C) * 0.25 * L
        Y_inv = Y_own - cos(C) * 0.25 * L

    else:
        C = (360 - course_own) * pi / 180
        X_inv = X_own - sin(C) * 0.25 * L
        Y_inv = Y_own + cos(C) * 0.25 * L
    return Ellipse((X_inv,Y_inv) ,2*B, L*2, angle=360-course_own,facecolor='red', alpha=0.6)

def construction_line(list_own):
    """
    ownShip:[x，y，航向,速度,船长，船宽]
    """
    return Rectangle(xy=(list_own[0],list_own[1]) ,width=200, height=1, angle=450-list_own[2],color="red")

def construction_area(list_own):
    """
    ownShip:[x，y，航向,速度,船长，船宽]
    """
    L = 3704
    B = 1481
    X_own = list_own[0]
    Y_own = list_own[1]
    course_own=list_own[2]

    return Ellipse((X_own,Y_own) ,2*B, L*2, angle=360-course_own,facecolor='blue', alpha=0.2)


